import { Stack } from "@mui/material"
import { PuzzleInput } from "../Atoms"
import { options, usePuzzleState } from "../Atoms/PuzzleInput"

const HomePage = () => {
    const puzzleState = usePuzzleState(options.example)
    return <Stack justifyContent="center" alignItems="center" sx={{ marginBottom: 1080 }}>
        <PuzzleInput puzzleState={puzzleState} />
    </Stack>
}

export default HomePage
